import { useState } from "react";
import Dropdown from "./Dropdown";
import YouTubeEmbed from "./YouTubeEmbed";

function Dropdown2({ children, name, positions, moves, style }) {
  const [dropdown, setDropdown] = useState(false);
  return (
    <div>
      <button className="dropdown2-btn" onClick={() => setDropdown(!dropdown)}>
        {name}
      </button>
      {dropdown &&
        positions.map((position, index) => (
          <Dropdown name={position} key={index}>
            {moves
              .filter((move) => move.position === position)
              .map((move) => (
                <YouTubeEmbed videoId={move.id}></YouTubeEmbed>
              ))}
          </Dropdown>
        ))}
    </div>
  );
}

export default Dropdown2;
